script: |
  super -f text -I q7839.spq | sort > q7839.out

inputs:
  - name: q7839.spq
    data: |
      SELECT DISTINCT col0 FROM tab2 (FORMAT parquet) AS cor0 WHERE NULL BETWEEN + col0 AND col1 * 26 + + col2 + - col1 + - CAST ( + col0 AS INTEGER ) * + col2 * col2;
  - name: tab2

outputs:
  - name: q7839.out
    data: |
